import React, { Component } from 'react';
import styles from './App.module.scss';
import './App.scss';

import profilePic from "./assets/jpg/jennifer_portrait.JPG";

class App extends Component {
	constructor(props) {
	  super(props);

	  this.state = {
		user: {
			name: {
				first: "Jennifer",
				last: "Haggerty"
			},
			email: "thejenniferhaggerty@protonmail.com",
			location: "Remote, GEORGIA United States",
			website: "https://studiovonjenn.com",
			age: 100,
			pronouns: "She/xe",
			photo: profilePic,
			quote: "wee :D",
			about: `Jennifer enjoys developing websites and apps that warrant repeat visits through their accessibility
			and ease of use in frontend development.`,
			likeToMeet: `I'd like to meet people interested in video games and talking code.`
		}
	  };
	}

	render (){
		const user = this.state.user;

		const PhotoBox = () => {
			return (
				<div className={styles.profilePic}>
					<span className={styles.h1}>{user.name.first}</span>
					<div className={
						styles.dflex 
						+ " " + 
						styles.flexRow 
						+ " " + 
						styles.spaceBetween 
						+ " " + 
						styles.panels}
					>
						<div className={styles.leftPanel}>
							<img 
								src={user.photo}
								alt={user.name.first + "'s profile photo"}
							/>
						</div>
						<div className={styles.rightPanel}>
							<div className={styles.row}>
								"{user.quote}"
							</div>
							<div className={styles.row}>
								{user.pronouns}
								<br />
								{user.age} years old
							</div>
							<div className={styles.row}>
								{user.location}
							</div>
							<div className={styles.row}>
								Last updated: today
							</div>
						</div>
					</div>
					<a href={user.website}>View more pics</a>
				</div>
			)
		}

		const ContactBox = () => {
			return(
				<div className={styles.contact}>
					<h2>Contacting {user.name.first}</h2>
					<table>
						<tbody>
							<tr>
								<th>
									Email
								</th>
								<td>
									<a href={"mailto:" + user.email}>
										Send Message
									</a>
								</td>
								<th>
									Current Website
								</th>
								<td>
									<button
										type="button"
										className={styles.btnAsLink}
										onClick={() => {
											window.navigator.clipboard.writeText(window.location.href);
										}}
										aria-label="Click to copy url and share it."
									>
										Forward to friend
									</button>
								</td>
							</tr>
							{/**
							<tr>
								<th>

								</th>
								<td>
									Add to Friends
								</td>
								<th>Bookmark</th>
								<td>
									<button
										type="button"
										onClick={() => {
											//print resume
										}}
									>
										Add to Favorites
									</button>
								</td>
							</tr>
							<tr>
								<th></th>
								<td>Instant Message</td>
								<th>Block website</th>
								<td>
									<button
										type="button"
										onClick={() => {
											//pop module asking if user wants to request deblock lint via email
											//send email
											//add ip to blocklist
										}}
									>Block User
									</button>
								</td>
							</tr>
							<tr>
								<th></th>
								<td>
									<a href="local">Add to Group</a>
								</td>
								<th>Click to be navigated to a review site</th>
								<td>
									<button 
										onClick={() => {
											// navigate to social site
										}}
									>
										Rank User
									</button>
								</td>
							</tr>
							 * 
							 */}
						</tbody>
					</table>
				</div>
			)
		}

		const NetworkBox = () => {
			return (
				<div className={styles.network}>
					<h1>{user.name.first} is a web developer in your virtual network</h1>
				</div>
			)
		}

		const BlurbBox = () => {
			const AboutMe = () => {
				return (
					<div>
						<h3>About me:</h3>
						<div>
							{user.about}
						</div>
					</div>
				)
			}

			const LikeToMeet = () => {
				return (
					<div>
						<h3>Who I'd like to meet:</h3>
						<div>
							{user.likeToMeet}
						</div>
					</div>
				)
			}

			return (
				<>
					<h2 className='orange_header'>{user.name.first}'s Blurbs</h2>
					<AboutMe />
					<LikeToMeet />
				</>
			)
		}

		return (
			<div className={styles.app + " " + styles.dflex}>
				<header className={styles.banner} aria-hidden="true">
					<span className="hidden">
						<h2 className="hidden">Search:</h2>
						For now this is a placeholder to display the pretty blue banner.
						TODO: Add the Search bar feature that will search and highlight terms in page or,
							if the user selects search the web we'll send them over to Brave.
					</span>
				</header>
				<nav className={styles.navigation} aria-hidden="true">
					<span className="hidden">
						<h2 className="hidden">Navigation:</h2>
						Navigation placeholder.
					</span>
				</nav>
				<main className={styles.dflex + " " + styles.flexRow}>
					<section className={styles.leftPanel}>
						<PhotoBox />
						<ContactBox />
						<div className={styles.interests}></div>
						<div className={styles.details}></div>
						<div className={styles.school}></div>
						<div className={styles.networking}></div>
						<div className={styles.companies}></div>
					</section>
					<section className={styles.rightPanel}>
						<NetworkBox />
						<div className={styles.blog}></div>
						<BlurbBox />
						<div className={styles.friends}></div>
						<div className={styles.comments}></div>
					</section>
				</main>
				{/*
				<footer className={styles.footer}></footer>
				*/}
			</div>
		)
	}
}

export default App;
